import { Model } from '..';
const model = Model.withLogicalClock(1234);
model.api.root({
    foo: {
        bar: {
            x: 1,
            y: 2,
        },
    },
});
console.log(model.root + '');
console.log(model.view());
const bar = model.api.obj(['foo', 'bar']);
console.log(bar + '');
bar.set({
    x: 24,
    z: 42,
});
console.log(bar + '');
console.log(bar.view());
bar.del(['y']);
console.log(bar + '');
console.log(bar.view());
console.log(model.view());
